package bean;

public class JF {

	String username;
	String shijian;
	String yj;
	String sj;
	String zongfeiyong;
	String jiaofei;
	
	public JF() {
		super();
		// TODO Auto-generated constructor stub
	}

	public JF(String username, String shijian, String yj, String sj,
			String zongfeiyong, String jiaofei) {
		super();
		this.username = username;
		this.shijian = shijian;
		this.yj = yj;
		this.sj = sj;
		this.zongfeiyong = zongfeiyong;
		this.jiaofei = jiaofei;
	}

	public String getUsername() {
		return username;
	}

	public void setUsername(String username) {
		this.username = username;
	}

	public String getShijian() {
		return shijian;
	}

	public void setShijian(String shijian) {
		this.shijian = shijian;
	}

	public String getYj() {
		return yj;
	}

	public void setYj(String yj) {
		this.yj = yj;
	}

	public String getSj() {
		return sj;
	}

	public void setSj(String sj) {
		this.sj = sj;
	}

	public String getZongfeiyong() {
		return zongfeiyong;
	}

	public void setZongfeiyong(String zongfeiyong) {
		this.zongfeiyong = zongfeiyong;
	}

	public String getJiaofei() {
		return jiaofei;
	}

	public void setJiaofei(String jiaofei) {
		this.jiaofei = jiaofei;
	}
	
	
	
}
